// Navbar.js

import React from 'react';
// import { Link } from 'react-router-dom'; // Jika Anda menggunakan React Router
import './Navbar.css';

const Navbar = () => {
  return (
    <nav>
          <img src='' alt=''/>
    </nav>
  );
};

const Sidebar = () => {
  return (
    <div className='sidebar'>
      <ul>
        <li>Management Stor</li>
      </ul>
    </div>
  )
}

export default Navbar;
